---
config:
  layout: elk
  elk:
    nodePlacementStrategy: SIMPLE
---
classDiagram
    direction TB

    class Hagimobile {
        <<abstract>>
        +move(Node) void
        +run()* void
    }

    class AgentRuntime {
        <<interface>>
        +start() void
        +migrate(Node) void
        +shutdown() void
    }

    class DefaultAgentRuntime {
        +start() void
        +migrate(Node) void
    }

    class Server {
        +start() void
        #handleClient(Socket) void
    }

    class ServiceServer {
        +registerService(name, service) void
        +getService(Class) T
        +currentFor(agent)$ ServiceServer
    }

    class Node {
        <<Serializable>>
        -name: String
        -port: int
    }

    class MigrationPayload {
        <<Serializable>>
        -agentState: byte[]
        -agentClasses: Map
    }

    class AgentLoader {
        +defineClassFromBytes(name, bytes) Class
    }


    Hagimobile --> AgentRuntime : runtime
    AgentRuntime <|.. DefaultAgentRuntime
    DefaultAgentRuntime --> MigrationPayload : creates
    DefaultAgentRuntime --> AgentLoader : uses
    Server --> DefaultAgentRuntime : creates
    Server <|-- ServiceServer
